61	Welcome to Heartland Hub	welcome-to-heartland-hub	<div id="Content" style="margin: 0px; padding: 0px; position: relative; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: center;"><p style="margin: 10px 28.7969px; padding: 0px; clear: both; line-height: 1.5;"></p><p style="text-align: left; "><span style="font-family: Lato; font-size: 18px;">Hello! I’m Laura, the creator behind Heartland Hub, and I’m delighted to have you here. This website has been brewing for quite some time, and I’m so proud to finally share it with you.</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><span style="font-family: Lato; font-size: 18px;">It all started with a mix of unexpected circumstances - technical challenges, learning new skills on the fly, and a spark of inspiration from Richard’s video, where he pondered that there are many </span><b><span style="font-family: Lato; font-size: 18px;">authentic, friendly, home grown and family-run businesses</span></b><span style="font-family: Lato; font-size: 18px;"> all around us that we might never know about.</span></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">I'd been thinking about developing a directory to use my newly learned skills, and his words landed at exactly the right moment. I started building this site from scratch within an hour.&nbsp;&nbsp;</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">This journey has not been straightforward. I’m sure many of you will resonate when I say that a few short years ago, everything in life just felt like it broke. </span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">In rebuilding, I realised how much I didn’t understand about the digital world - and decided to change that.</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">As I learned, I began to see the potential for building a space where </span><strong><span style="font-family: Lato; font-size: 18px;">local businesses, artisans, and communities could connect</span></strong><span style="font-family: Lato; font-size: 18px;"> without relying solely on tech giants like Meta, Facebook, or Google.</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Now, </span><strong><span style="font-family: Lato; font-size: 18px;">Heartland Hub exists as a true labour of love -&nbsp;</span></strong><span style="font-family: Lato; font-size: 18px;">a community hub for authentic connections. It’s born from a desire to uplift </span><strong><span style="font-family: Lato; font-size: 18px;">local, home-based, and traditional businesses</span></strong><span style="font-family: Lato; font-size: 18px;"> that might otherwise go unnoticed</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span><strong style="color: inherit; font-family: inherit; font-size: 24px;"><span style="font-family: Lato;">What Heartland Hub is All About</span></strong></p><p style="text-align: left;"><strong style="color: inherit; font-family: inherit; font-size: 24px;"><span style="font-family: Lato;"><br></span></strong><strong><span style="font-family: Lato; font-size: 18px;">Heartland Hub is a community-driven platform</span></strong><span style="font-family: Lato; font-size: 18px;"> where local businesses, creators, and traditional craft practitioners can showcase what they do. This site highlights authentic, family, homegrown and craft focused businesses - from bakers and farmers to holistic practitioners and weavers.</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span><span style="font-family: Lato; font-size: 18px;">My goal is simple: </span><strong><span style="font-family: Lato; font-size: 18px;">to connect people with genuine, skilful artisans in their area.</span></strong></p><p style="text-align: left;"><strong><span style="font-family: Lato; font-size: 18px;"><br></span></strong><span style="font-family: Lato; font-size: 18px;">The site is still in its early stages—a </span><strong><span style="font-family: Lato; font-size: 18px;">Minimum Viable Product (MVP)</span></strong><span style="font-family: Lato; font-size: 18px;">—but there’s already so much to explore. As Heartland Hub grows, business owners will soon be able to:</span></p><ul><li style="text-align: left;"><strong><span style="font-family: Lato; font-size: 18px;">Create their own listings</span></strong></li><li style="text-align: left;"><strong><span style="font-family: Lato; font-size: 18px;">Share their stories</span></strong></li><li style="text-align: left;"><strong><span style="font-family: Lato; font-size: 18px;">Connect with new customers</span></strong><span style="font-family: Lato; font-size: 18px;"> who value quality, craftsmanship, and community.</span></li></ul><h3 style="text-align: left;"><strong><span style="font-family: Lato;"><br></span></strong></h3><h3 style="text-align: left;"><strong><span style="font-family: Lato;">How You Can Get Involved</span></strong></h3><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Are you a local business owner, artisan, or craft practitioner? Or maybe someone passionate about supporting your community? I’d love to hear from you!</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Right now, you can:</span></p><ul><li style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Submit your business details via the </span><strong><span style="font-family: Lato; font-size: 18px;">Add a Business</span></strong><span style="font-family: Lato; font-size: 18px;"> button.</span></li><li style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Reach out to me through the </span><strong><span style="font-family: Lato; font-size: 18px;">Contact Us</span></strong><span style="font-family: Lato; font-size: 18px;"> page if you’d like to contribute a blog post or share your thoughts.</span></li><li style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Explore the </span><strong><span style="font-family: Lato; font-size: 18px;">Directory</span></strong><span style="font-family: Lato; font-size: 18px;"> for sample business listings - search and location features are coming soon!</span></li><li style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Let me know about other features and ideas that would help you and our users.</span></li></ul><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Registered users will soon be able to:</span></p><ul><li style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Submit their own blog posts (with approval to ensure alignment with our values).</span></li><li style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Leave </span><strong><span style="font-family: Lato; font-size: 18px;">reviews and comments</span></strong><span style="font-family: Lato; font-size: 18px;"> on listings and posts, creating a supportive and respectful space for everyone.</span></li></ul><h3 style="text-align: left;"><strong><span style="font-family: Lato;">Support and Collaboration</span></strong></h3><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Heartland Hub is currently a passion project that I hope to keep </span><strong><span style="font-family: Lato; font-size: 18px;">free for users and business owners.</span></strong><span style="font-family: Lato; font-size: 18px;"> However, there are ongoing costs like hosting and domain fees. </span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">If you’d like to support this endeavour, </span><strong><span style="font-family: Lato; font-size: 18px;">donations are deeply appreciated -&nbsp;</span></strong><span style="font-family: Lato; font-size: 18px;">your support will help keep the site running smoothly and allow me to add even more features over time.</span></p><p style="text-align: left;"><br></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Additionally, if you’re looking for help with </span><strong><span style="font-family: Lato; font-size: 18px;">web services</span></strong><span style="font-family: Lato; font-size: 18px;">, I’d love to collaborate. Whether it’s creating an online presence for your business or refining your digital strategy, I’m here to help!</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span><strong style="color: inherit; font-family: inherit; font-size: 24px;"><span style="font-family: Lato;">Thank You for Being Here</span></strong></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">When I started this project, it felt like a “right place, right time” moment. I hope Heartland Hub can become the same for you - a place to discover, connect, and celebrate the <b>local and traditional businesses</b> that make our communities so special.</span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;"><br></span></p><p style="text-align: left;"><span style="font-family: Lato; font-size: 18px;">Let’s build a thriving, special hub for <b>craftsmanship, connection, and community - together.</b> ❤️</span></p></div>	2024-10-28 20:27:32.422255+00	1	13	Hello! I’m Laura, the creator behind Heartland Hub. This site was born from a desire to connect people with local, home-based, and traditional businesses that might otherwise go unnoticed. With Heartland Hub, I hope to create a thriving community where craft-focused businesses can share their stories and connect with people who appreciate quality and authenticity. Thank you for joining me on this journey!	2024-12-20 16:12:26.413935+00	Heartland Hub, local businesses, home-based businesses, traditional businesses, artisans, community directory, support small businesses, handcrafted goods, local artisans, community-driven platform, skilled artisans, connect with artisans	\N	image/upload/placeholder	2024-11-10 16:40:20+00	86	hope for future thriving communities		Welcome to Heartland Hub! This community-driven platform connects people with local, home-based, and traditional businesses.
62	Frequently Asked Questions	frequently-asked-questions	<p><font face="Lato"><b><span style="font-size: 18px;">General FAQs</span></b></font></p><p><font face="Lato"><b><span style="font-size: 18px;">1. What is Heartland Hub?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Heartland Hub is an online platform dedicated to showcasing local businesses, artisans, and community-focused events. Our mission is to support and celebrate local craft, tradition, and community.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">2. Who can join Heartland Hub?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Any local business, artisan, or community group that aligns with our values can join. Whether you create handmade goods, offer unique services, or organise community events, we’d love to have you.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">3. How much does it cost to join?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Joining Heartland Hub is currently free. In the future, we may introduce affordable plans for added features and visibility.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">Business/Member FAQs</span></b></font></p><p><font face="Lato"><b><span style="font-size: 18px;">4. How can I add my business to the directory?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">You can add your business by filling out our </span><a href="https://heartlandhub.co.uk/business/submit/" target="_blank"><span style="font-size: 18px;">"Add Your Business" </span></a><span style="font-size: 18px;">form. Once submitted, our team will review it to ensure it aligns with our guidelines before publishing it on the site.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">5. Can I edit my business listing after it's live?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Yes! Once your business is listed, you'll have access to a link to manage your listing. You can update your details anytime.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">6. What kind of businesses are featured on Heartland Hub?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">We feature businesses and groups focused on craft, tradition, and community, including handmade goods, workshops, and locally sourced products.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">Event FAQs</span></b></font></p><p><font face="Lato"><b><span style="font-size: 18px;">7. Can I add events to Heartland Hub?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Absolutely! The Events feature will be coming soon, but for now, if you're hosting an event that fits our theme, you can submit it through our "</span><a href="https://heartlandhub.co.uk/business/submit/" target="_blank"><span style="font-size: 18px;">Add a Business</span></a><span style="font-size: 18px;">" feature. Please include all relevant details like date, time, location, and a description.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">8. Are there restrictions on the type of events listed?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">We prioritise events that focus on community, education, and local wares, services and traditions. Events must align with our values to be approved.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">9. How can I make changes to an event I’ve submitted?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Once your event is live, you’ll have access to a link to manage or update your event details.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">User FAQs</span></b></font></p><p><font face="Lato"><b><span style="font-size: 18px;">10. Do I need an account to use Heartland Hub?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">No account is needed to browse businesses and events. However, you will need to create an account to add a listing, and access special features. In the future we will have additional features that will allow you to save favourites, RSVP to events, and more.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">11. How can I contact a business or event organiser?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Each listing includes contact details for direct communication. If you have issues connecting, feel free to reach out to us, and we’ll assist.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">Technical FAQs</span></b></font></p><p><font face="Lato"><b><span style="font-size: 18px;">12. What if I encounter an issue with the website?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Please use the </span><a href="https://heartlandhub.co.uk/contact/" target="_blank"><span style="font-size: 18px;">"Contact Us" </span></a><span style="font-size: 18px;">form to report any issues or concerns. We aim to resolve technical problems quickly.</span></font></p><p><font face="Lato"><br></font></p><p><font face="Lato"><b><span style="font-size: 18px;">13. Is my information safe on Heartland Hub?</span></b></font></p><p><font face="Lato"><span style="font-size: 18px;">Yes, we take privacy seriously and only collect the information needed to provide our services. Check our Privacy Policy for more details.</span></font></p>	2024-12-04 09:58:42.515527+00	1	13	Heartland Hub's FAQ page answers your questions about joining the platform, adding your business, submitting events, and using the website. Supporting local craft, tradition, and community.	2024-12-21 16:17:18.574494+00	<title>FAQs | Heartland Hub - Supporting Local Businesses & Community</title>\r\n<meta name="description" content="Find answers to common questions about Heartland Hub, your online platform for local businesses, artisans, and community events. Learn how to join, add your business, or submit events.">\r\n<meta name="keywords" content="Heartland Hub FAQs, local businesses directory, community events, artisan marketplace, add your business, event submissions, local crafts, small business support">\r\n<meta name="author" content="Heartland Hub">\r\n<meta name="viewport" content="width=device-width, initial-scale=1.0">\r\n<meta name="robots" content="index, follow">	\N	image/upload/v1733306322/k4ovjeiwzmwxae8yshu6.jpg	2024-12-04 09:56:15+00	19	A green field with blue sky	Jahoo Clouseau	Explore Heartland Hub's FAQ page to learn how to join, add your business, or submit events. Discover how we support local crafts, traditions, and community conn
